shader_body
{
    // Define PI
    #define PI 3.14159265359

    // Adjust UVs
    uv = uv * 2.0 - 1.0;
   // uv *= uv.x / uv.y;

    // Make a tube
    float f = 3.0 / length(uv);

    // Add the angle
    f += atan(uv.x, uv.y) / (PI / 12.0);

    // Let's roll
    f -= time;

    // Make it black and white
    f = 1.0 - clamp(sin(f * PI * 1.0) * dot(uv, uv) * texsize.y / 15.0 + 0.5, 0.0, 1.0);

    // Add the darkness to the end of the tunnel
    f *= sin(length(uv) - 0.05);

    // Output the final color
    ret =vec4(f, f, f, 1.0).xyz;
}

